<script type="text/javascript">
$( "circle" ).parent().hover(
  function() {
    $( this ).children("[id$=-hide]").fadeIn();
  }, function() {
  	if (!this.hasClass('clicked')) {
  	    $( this ).children("[id$=-hide]").fadeOut();
  	}
  }
);

$( "circle" ).on("click",
  function() {
  	$( this ).toggleClass('clicked');
    $( this ).children("[id$=-hide]").show();
  }
);

$("[fill='#9B1D26']").on('click', function(){
	var desc = $(this).parent().parent().find('[id$=-hide]');
	$.scrollTo(desc, 800, {
		onAfter: function(){
			desc.show();
		}
	});

})

</script>
